# 目的地の検索 [目的地名前, 目的地座標, 目的地ID]
def get_dest_list():
    dest_list = ['none', 'none', 'none']

    dest_name = dn
    dest_geocode = google_client.geocode(dest_name) # 位置情報を検索
    dest_cood = dest_geocode[0]['geometry']['location'] # 軽度・緯度の情報のみ取り出す
    dest_id = dest_geocode[0]['place_id']

    # dest_cood = {'lat': 35.6579188, 'lng': 139.7456161}
    # dest_id = 'null'

