# 現在地からのルート検索 [[現在地名前, 現在地座標, 現在地ID, 距離(m), 曲がる回数, 文字による案内, URL], [座標たち(n個)], [各座標間の距離(m)(n-1個)]]
def get_now_route_list(dest_list):
    now_route_list = [['none', 'none', 'none', 'none', 'none', 'none', 'none']]

    now_name = nn
    now_geocode = google_client.geocode(now_name) # 位置情報を検索
    now_cood = now_geocode[0]['geometry']['location'] # 軽度・緯度の情報のみ取り出す
    now_id = now_geocode[0]['place_id']

    # now_cood = {'lat': 35.6466711, 'lng': 139.7464619}
    # now_id = 'null'

    dest_name = dest_list[0]
    dest_cood = dest_list[1]
    dest_id = dest_list[2]

    now_route_list[0][0] = now_name
    now_route_list[0][1] = now_cood
    now_route_list[0][2] = now_id

    print("------------------------------------------")
    print("現在地：" + now_name)
    print("座標：" + str(now_cood))
    print("ID：" + str(now_id))
    # print("クチコミ：" + dest_review_text)
    print("------------------------------------------")
    print("目的地：" + dest_name)
    print("座標：" + str(dest_cood))
    print("ID：" + str(dest_id))
    # print("クチコミ：" + dest_review_text)
    print("------------------------------------------")
    print()

    # ルート算出
    now_route = google_client.directions(now_cood, dest_cood, mode="walking", language = 'ja')
    # print(now_route[0]['legs'][0]['steps'])
    now_route_distance = now_route[0]['legs'][0]['distance']['value'] #str
    now_route_steps = now_route[0]['legs'][0]['steps'] #list
    now_turn = str(now_route_steps).count('turn') #int
    now_route_text = ""
    now_route_part_cood = [] #coodを格納
    now_route_part_distance = []
    for i in now_route_steps:
        now_route_steps_text = ""
        now_route_part_distance.append(i['distance']['value'])
        now_turn_cood = i['start_location']
        now_route_part_cood.append(now_turn_cood)
        # if str(i).count('turn') > 0:
        #     turn_place_tmp = client.places_nearby(location=turn_cood_tmp, radius=5, language='ja') # 曲がり角の近くにある建物をサーチ
        #     for j in turn_place_tmp['results']:
        #         try:
        #             if j['name'] == dest:
        #                 continue
        #             turn_place_name = j['name'] #str
        #             break #1個目だけを取り出す
        #         except:
        #             continue
        #     route_str += turn_place_name + "を"
        now_route_steps_text += re.sub(re.compile('<.*?>'), '', str(i['html_instructions'])) + '。'
        now_route_text += now_route_steps_text
    now_route_part_cood.append(dest_cood)
    if '目的地' in now_route_text:
        index = now_route_text.find('目的地')
        now_route_text = now_route_text[:index] + '。' + now_route_text[index:]
    now_route_text = now_route_text.replace('使用が制限されている道路','')
    now_route_text = now_route_text.replace('一部使用制限のある道路','')

    # ルートを画像表示
    now_url = get_url(now_route_part_cood)

    now_route_list[0][3] = now_route_distance
    now_route_list[0][4] = str(now_turn)
    now_route_list[0][5] = now_route_text
    now_route_list[0][6] = now_url
    now_route_list.append(now_route_part_cood)
    now_route_list.append(now_route_part_distance)

    print(now_route_list)
    print()

    return now_route_list


# ランドマーク候補を抽出 [[ランドマーク名前, ランドマーク座標, ランドマークID, 距離(m), 曲がる回数, 文字による案内, URL, レビュー数, 評価関数の値, [types]],...]
def get_landmark_list(dest_list, now_route_list):

    # 一個の円
    def get_landmark_list_part(cood, dest_list, now_id, landmark_list, destmode):
        landmark_type = [['restaurant',1], ['subway_station',1000], ['train_station',1000]]
        # 投票結果を反映 & 投票数を重みに反映 投票結果があまり面白くなかったので自分でランドマークを選ぶのもあり

        dest_cood = dest_list[1]
        dest_id = dest_list[2]
        
        if destmode == True:
            rad = 200
            distance_weight = 3
        else:
            rad = 40
            distance_weight = 1

        nextPageToken = ''

        # 最大60件まで
        while True:
            # ランドマーク候補検索
            land_result = google_client.places_nearby(location=cood, radius=rad, language='ja', page_token=nextPageToken)
            # 近くにあるランドマーク候補の数だけ繰り返す
            for i in land_result['results']:
                try:
                    landmark_details_list = ['none', 'none', 'none', 'none', 'none', 'none', 'none', 'none', 'none']
                    # lt_flag = False
                    # lt_score = 0
                    # for lt in landmark_type: # 指定したタイプかどうか
                    #     if lt[0] in i['types']:
                    #         lt_flag = True
                    #         lt_score = lt[1]
                    #         break
                    # if lt_flag == False: # 指定したタイプじゃない
                    #     continue
                    if i['place_id'] == now_id: # 現在地と一緒
                        continue
                    if i['place_id'] == dest_id: # 目的地と一緒
                        continue
                    li_flag = False
                    for li in landmark_list:
                        if i['place_id'] == li[2]: # すでにあるか
                            li_flag = True
                            break
                    if li_flag == True: # すでにある
                        continue
                    if not 'user_ratings_total' in i: # レビューがない
                        continue
                    land_name = i['name'] #str
                    land_cood = i['geometry']['location'] #dict
                    land_id = i['place_id'] #str
                    land_ratings = i['user_ratings_total'] #int
                    land_types = i['types'] #list
                    # print("名前：" + land_name)
                    # print("座標：" + str(land_cood))
                    # print("評価数：" + str(land_ratings))
                    # print("types：" + str(types))
                    # print("ID：" + land_id)

                    # ルート算出
                    land_route = google_client.directions(land_cood, dest_cood, mode="walking", language = 'ja')
                    # print(land_route[0]['legs'][0]['steps'])
                    land_route_distance = land_route[0]['legs'][0]['distance']['value'] #int
                    land_route_steps = land_route[0]['legs'][0]['steps'] #list
                    land_turn = str(land_route_steps).count('turn') #int
                    land_route_text = ""
                    land_route_part_cood = [] #coodを格納
                    # now_route_part_distance = []
                    for i in land_route_steps:
                        land_route_steps_text = ""
                        # now_route_part_distance.append(i['distance']['value'])
                        land_turn_cood = i['start_location']
                        land_route_part_cood.append(land_turn_cood)
                        # if str(i).count('turn') > 0:
                        #     turn_place_tmp = client.places_nearby(location=turn_cood_tmp, radius=5, language='ja') # 曲がり角の近くにある建物をサーチ
                        #     for j in turn_place_tmp['results']:
                        #         try:
                        #             if j['name'] == dest:
                        #                 continue
                        #             turn_place_name = j['name'] #str
                        #             break #1個目だけを取り出す
                        #         except:
                        #             continue
                        #     route_str += turn_place_name + "を"
                        land_route_steps_text += re.sub(re.compile('<.*?>'), '', str(i['html_instructions'])) + '。'
                        land_route_text += land_route_steps_text
                    land_route_part_cood.append(dest_cood)
                    if '目的地' in land_route_text:
                        index = land_route_text.find('目的地')
                        land_route_text = land_route_text[:index] + '。' + land_route_text[index:]
                    land_route_text = land_route_text.replace('使用が制限されている道路','')
                    land_route_text = land_route_text.replace('一部使用制限のある道路','')

                    # ルートを画像表示
                    land_url = get_url(land_route_part_cood)

                    # 評価関数
                    land_evaluated = land_ratings*3 - land_route_distance*distance_weight - land_turn*30

                    landmark_details_list[0] = land_name
                    landmark_details_list[1] = land_cood
                    landmark_details_list[2] = land_id
                    landmark_details_list[3] = land_route_distance
                    landmark_details_list[4] = str(land_turn)
                    landmark_details_list[5] = land_route_text
                    landmark_details_list[6] = land_url
                    landmark_details_list[7] = land_ratings
                    landmark_details_list[8] = str(land_evaluated)
                    landmark_details_list.append(land_types)

                    landmark_list.append(landmark_details_list)

                except:
                    continue
            
            if 'next_page_token' in land_result:
                nextPageToken = land_result['next_page_token']
            else: # nextPageTokenが発行されなくなったら離脱
                break
            print('next')
            time.sleep(3) # delayを入れないとエラーになる

        return

    # 再帰的に直線の中間をとって円を描く
    def move_circle(cood1, cood2, distance, dest_list, now_id, landmark_list):

        # distanceが一定値を下回ったら再帰終了
        if distance <= 50:
            return
        distance /= 2

        # 呼び出し回数が200超えたら終了
        nonlocal recall_count
        if recall_count >= 200:
            return
        recall_count += 1

        # 中心座標の計算
        center_cood = {}
        center_cood['lat'] = (cood1['lat'] + cood2['lat']) / 2
        center_cood['lng'] = (cood1['lng'] + cood2['lng']) / 2
        
        get_landmark_list_part(center_cood, dest_list, now_id, landmark_list, False)

        # 再帰
        move_circle(cood1, center_cood, distance, dest_list, now_id, landmark_list)
        move_circle(center_cood, cood2, distance, dest_list, now_id, landmark_list)
        
        return


    recall_count = 0

    landmark_list = []
    cood_list = now_route_list[1] #list
    distance_list = now_route_list[2] #list

    # ルート上の直線の数だけやる
    for i in range(len(distance_list)):
        get_landmark_list_part(cood_list[i], dest_list, now_route_list[0][2], landmark_list, False) # 始点
        move_circle(cood_list[i], cood_list[i+1], distance_list[i], dest_list, now_route_list[0][2], landmark_list)
    get_landmark_list_part(cood_list[-1], dest_list, now_route_list[0][2], landmark_list, True) # destmode=True 目的地の周辺は広範囲探索（ただし重み弱め）

    print("再帰呼び出し数:" + str(recall_count))
    print("ランドマーク数:" + str(len(landmark_list)))
    print()
    print('----------------------------------')
    print(landmark_list)
    print('----------------------------------')
    print()

    return landmark_list


# ルートが書かれたurlを出力
def get_url(route):
    url = 'https://www.google.com/maps/dir/'
    url += str(route[0]['lat'])+","+str(route[0]['lng'])+"/"+str(route[-1]['lat'])+","+str(route[-1]['lng'])
    url += '/data=!3m1!4b1!4m2!4m1!3e2?entry=ttu'
    return url



# 最初に回す関数（ランドマーク検索もろもろ）
def init():
    dest_list = get_dest_list()
    now_route_list = get_now_route_list(dest_list)
    landmark_list = get_landmark_list(dest_list, now_route_list)

    with open('./cheat/'+ nn + '_to_' + dn + '.txt', mode='w') as f:
        f.write(str(dest_list))
        f.write('\n\n')
        f.write(str(now_route_list))
        f.write('\n\n')
        f.write(str(landmark_list))

    return dest_list, now_route_list, landmark_list




